import React from 'react'
import "./Footer.css"

const Footer = () => {
  return (
    <div className='footer-container'>
        <div className='footer-parent'>
            <img src={require ("E:/CLG\Projects\my_portfolio\src\assets\Home\shape-bg.png").default} 
            alt='not available'/>
        </div>
    </div>
  )
}

export default Footer
